import React, { useEffect, useState } from 'react'
import {useParams} from 'react-router-dom'
import Header from '../../components/Header/Header';
import Banner from '../../components/Banner/Banner';
import About from '../../components/Home/About/About';
import Features from '../../components/Home/Features/Features';
import Partners from '../../components/Home/Partners/Partners';
import Services from '../../components/Home/Services/Services';
import Parallax from "../../components/Parallax/Parallax";
import Contact from "../../components/Home/Contact/Contact";


const Custom = () => {
    const {id} = useParams();
    cono
    const [hasError, setHasError] = useState(false)
    const [customPageData, setCustomPageData] = useState({});
    const componentData = [];

    useEffect(() => {
        fetch(`http://localhost:1337/${id}`)
        .then(res => res.json())
        .then(data => setCustomPageData(data))
        .catch(err => {
            console.log(err)
            setHasError(true)
        })

    }, [id]);

    useEffect(() => {
        if(Object.keys(customPageData).length){
            for (const [key, value] of Object.entries(customPageData)) {
                if(dataOptions.hasOwnProperty(key)){
                    componentData.push(key)
                }
              }
        }
    }, [customPageData])

    const dataOptions = {
        Key_Features: () => <Features />,
        Client_Logos: () => <Partners />,
        Services: () => <Services />,
        Connection_Details: () => <Contact />,
        Banner: () => <Banner url={`http://localhost:1337/${id}`} />,
        About: () => <About />,
        Main_Banner: () => <Parallax />
    }

    return (
        <>
         {
             hasError ? <div><h1>Sorry Page Not Found</h1></div> :
             <>
                <Header />
                {
                    componentData.length ? componentData.map((item) => dataOptions[item]) : null
                }
             </>
         }   
        </>
    )
}

export default Custom
